import React from 'react';
import {Form,Button,Input} from 'antd';

class Register extends React.Component{
	
	render(){
		return (
			<div>
				<Form
					name="register"
					onFinish={this.onFinish}
					onFinishFailed={this.onFinishFailed}
				>
					<Form.Item>
						<Input />
					</Form.Item>
				</Form>
			</div>
		);
	}
}

export default Register;
